import {useState,useEffect} from 'react'
import {showP} from '../api/api'
const Productlist = () => {
    const [product,setProduct] = useState([])

    const show = async() =>{
        try{
            const res =  await showP()
            setProduct(res.data)
            console.log(product)
        }catch(error){
            console.log(error)
        }
    }

    useEffect(()=>{
        show()
    },[])
  return (
    <div className='main'>
        <h1>ProductList</h1>
        <table>
            <td> 
                <th>Name</th>
                <th>Price</th>
                <th>Category</th>
                <th>Company</th>
                <tbody>
                    {
                        product.map((d,i)=>{
                            const {name,price,category,company} = d;
                            return(
                                <tr>
                                    <td>{name}</td>
                                    <td>{price}</td>
                                    <td>{category}</td>
                                    <td></td>
                                </tr>
                            )
                        })
                    }
                </tbody>
            </td>
        </table>
    </div>
  )
}

export default Productlist
